""" https://leetcode.com/problems/daily-temperatures/description/
739. Daily Temperatures - Medium

08/11/2021 22:38	Accepted https://leetcode.com/submissions/detail/537204353/
08/11/2021 TLE https://leetcode.com/submissions/detail/537195450/testcase/

Given an array of integers temperatures represents the daily temperatures, return an array answer such that answer[i] is the number of days you have to wait after the ith day to get a warmer temperature. If there is no future day for which this is possible, keep answer[i] == 0 instead.

Example 1:
Input: temperatures = [73,74,75,71,69,72,76,73]
Output: [1,1,4,2,1,1,0,0]

Example 2:
Input: temperatures = [30,40,50,60]
Output: [1,1,1,0]

Example 3:
Input: temperatures = [30,60,90]
Output: [1,1,0]

Constraints:
  1 <= temperatures.length <= 105
  30 <= temperatures[i] <= 100
"""

from typing import List

class Solution:
    def dailyTemperatures(self, temperatures: List[int]) -> List[int]:
        """
        Time Complexity: O(n)
        Space Complexity: O(n) for variables & additional counts array
        """
        # two pointers
        left, right = 0, 0
        # init counter array with 0s
        counts = [0] * (len(temperatures))

        # for each index (i) in counts
        for i in range(1, len(counts)):
            left = i - 1
            right = i
            print(f'{temperatures[left]} vs {temperatures[right]}')

            # increment right pointer until find a warmer temp
            #
            while right != len(counts) - 1 and temperatures[left] >= temperatures[right]:
                right += 1
                # print(f'Left{left} Right{right}')

            # right - left = how many days away is a warmer temp
            # if right is last temp and < left, leave at 0
            if right == len(temperatures) - 1 and temperatures[right] <= temperatures[left]:
                counts[left] = 0
            else:
                counts[left] = right - left
            # print(counts)

        return counts

class Solution:
    def dailyTemperatures(self, temperatures: List[int]) -> List[int]:
        counts = [0] * (len(temperatures))
        stack = []

        stack.append(len(temperatures) - 1)
        counts[len(temperatures) - 1] = 0

        i = len(temperatures) - 2

        while i >= 0:
            while stack and temperatures[i] >= temperatures[stack[-1]]:
                stack.pop()
            counts[i] = stack[-1] - i if stack else 0
            stack.append(i)
            i -= 1
        return counts

